import Card from "../UI/Card"

const Totals = props => {


    return (
        <div>
            <Card>
            <ul>
                {props.users.map((user) => (
                    <li key={user.coin}>
                    {user.coin}
                    </li>
                ))}
                </ul>
            </Card>
        </div>
    )


};

export default Totals;
